const totals={'First Year':{'1st Semester':{'lecture':2,'lab':2,'credit_units':4}},'Fourth Year':{'1st Semester':{'lecture':2,'lab':6,'credit_units':8}}};document.addEventListener("DOMContentLoaded",function(){for(const[year,semesters]of Object.entries(totals)){for(const[semester,details]of Object.entries(semesters)){document.getElementById(`lecture-${year}-${semester}`).innerText=details.lecture;document.getElementById(`lab-${year}-${semester}`).innerText=details.lab;document.getElementById(`credit_units-${year}-${semester}`).innerText=details.credit_units;}}});;